import React, { Component } from 'react';
import './App.css';

class Header extends Component {
  render() {
    return (
    <h1>{this.props.message}</h1>
    )
  }
}

function App() {
  return (
    <div className="App">
      <Header message='BusPoa transporte'/>
    </div>
  );
}

export default App;
